import React from "react";
import { ImageProvider } from "./context/ImageContext";
import { Button } from "./components/Button";
import { Carousel } from "./components/Carousel";
import { Slider } from "./components/Slider";

export const App = () => {
  return (
    <ImageProvider>
      <div>
        <Carousel />
        <div>
          {" "}
          <Button type="Cats" />
          <Button type="Sharks" />
        </div>

        <Slider />
      </div>
    </ImageProvider>
  );
};
